import React, { Component } from "react";
import "./TNode.css";

export default class TNode extends Component {
    state = {
        row,
        col,
        isStart,
        isFinish,
        isVisited
    };
  constructor(row, col, isStart, isFinish) {
    super();
    // this.setState = {
    //   row: row,
    //   col: col,
    //   isStart: isStart,
    //   isFinish: isFinish,
    //   isVisited: false,
    // };
    this.row = row;
    this.col = col;
    this.isStart = isStart;
    this.isFinish = isFinish;
    this.isVisited = false;
  }

  render() {
    return <div className="TNode">
        <code>${this.row}</code>
    </div>;
  }
}
